// Tab 컴포넌트가 선언된 파일 (예: Tab.tsx)
import './style.css';
import React from 'react';
import Button from './Button'; // Button 컴포넌트를 가져옴

interface ActiveProps {
    active: boolean;
}
interface TabWrapperProps extends ActiveProps {
    id: number;
    category: string;
    onClickCategory(event: React.MouseEvent<HTMLButtonElement>): void;
}

const Tab: React.FC<TabWrapperProps> = ({
    id,
    category,
    onClickCategory,
    active,
    ...props
}) => {
    return (
        <div className='TabWrapper'>
            <Button
                data-id={id}
                style={{
                    backgroundColor: 'white',
                    height: '80px',
                    minWidth: '240px',
                }}
                onClick={onClickCategory}
                {...props}
            >
                {category}
            </Button>
        </div>
    );
}

export default Tab;
